.
Resep : 
Bahan Utama : ğŸ’3buah tahu jepang rasa apa saja (aku pakai rasa udang)
Potong2 lalu gulirkan perlahan di tepung maizena lalu goreng dengan api sedang hingga kecoklatan ğŸ’1 cup jamur shemeji yg coklat. 
Bumbu: 
5 buah bawang putih rajang halus. (Saya pakai bawang putih kating, lb wangi dan ukurannya lebih besar) 
5 iris jahe muda.

Bahan saos : (Campur jadi satu aduk rata)
200ml air
1sdm @fibercreme supaya lebih creamy gurih.
3 sdm saos tiram
2 sdm kecap manis
1sdt minyak wijen
1/2 sdt lada bubuk
1/2 sdt garam
1sdt gula pasir.
1,5 sdt tepung maizena/tapioka

Cara : 
Tumis jahe, lalu masukan bawang putih tumis hingga harum, masukan jamur, tumis hingga layu. (Pakai api kecil)
Masukan tahu.
Tuang bahan saos, besarkan api.
Jika sudah mengental dan mendidih angkat. .
